import React from 'react'

const book = ({All, randomPick}) => {
  return (
    <div className='bookInfo' style={{
      display:'flex',
      flexDirection:'column',
      justifyContent: 'center'
    }}>
      <img />
      <span>{All.제목[randomPick]}</span>
      <br/>
      <span>{All.저자[randomPick]} 지음 | {All.가격[randomPick]}</span>
    </div>
  )
}

export default book
